import React from 'react'

const Home = () => {
  return (
    <div className='w-[95%] h-[95%] bg-[#bbbbbb] opacity-30 flex flex-row  '>
        <div className='bg-blue-500'></div>
        <div className='bg-yellow-200'></div>
    </div>
  )
}

export default Home
